import React, { useState } from "react";
import ListComp from "./project4/ListComp";
import { Route, Routes, useSearchParams } from "react-router-dom";
import PrintDetails from "./project4/PrintDetails";

function App() {
  let [select, setSelect] = useState(false);
  return (
    <>
      <Routes>
        <Route path="/" element={<ListComp setSelect={setSelect} />} />
        {select && <Route path="print" element={<PrintDetails />} />}
      </Routes>
    </>
  );
}

export default App;
